package net.DPandBacktrack;

import java.util.*;

public class UniquePath {
	public static int uniquePaths(int m, int n) {
        int[][] dp = new int[m][n];
        dp[0][0] = 1;
        for (int i=0;i<m;i++)
            for (int j=0;j<n;j++){
                if (i==0&&j==0)
                    continue;
                int up = i>0? dp[i-1][j] : 0;
                int left = j>0?dp[i][j-1] : 0;
                dp[i][j] = up+left;
            }
        return dp[m-1][n-1];
    }
	
	public static void main(String[] args){
		System.out.println( uniquePaths(3,7));
		boolean b = isAnagram("",
				"");
//		"", ""
		System.out.println(b);
		Integer i = 10;
	}
	
	public static boolean isAnagram(String s, String t) {
        Map<Character, Long> mapS = new HashMap<>(26);
        Map<Character, Long> mapT = new HashMap<>(26);
        constructMap(mapS, s);
        constructMap(mapT, t);
        if (mapS.size() != mapT.size()) return false;
        System.out.println(mapS.size());
        System.out.println(mapT.size());
        for (char key : mapS.keySet()){
            if ( mapT.containsKey(key)){
                if (!mapT.get(key).equals(mapS.get(key))) 
                	return false;
            }else{
                return false;
            }
        }
        return true;
    }
    public static void constructMap (Map<Character, Long> map, String s){
        for (char c : s.toCharArray()){
            if (map.containsKey(c)){
                map.put(c, map.get(c) + 1);
            }else{
                map.put(c,1l);
            }
        }
    }
}
